import * as action from "./actionsType";

export function vout() {
  return {
    type: action.UPVOTE,
  };
}

export function downvout() {
  return {
    type: action.DOWNVOTE,
  };
}

export function memsFetched(mems) {
  return { type: "FETCH_MEMS_SUCCESS", mems };
}
